        $name = $this->tablePrefix.$names;
        $sql = str_replace('`'.$names.'`',  '`'.$name.'`', $sql);
        Db::connect('install')->query("truncate table `{$name}`");
        if (!empty($sql)) {
            Db::connect('install')->execute($sql);
